import React, { useState, useEffect } from "react";

function App() {
  const [d, setData] = useState([{}]);

  useEffect(() => {
    fetch("/users")
      .then((res) => res.json())
      .then((data)=>{
        setData(data);
        console.log(data, "dddddddddddddddddd")
      });
  },[]);

  return (
    <div>
      <h1>jayay</h1>
    </div>
  );
}

export default App;
